import React from 'react'
import { Link } from 'react-router-dom'
import s from './CategoryCard.module.css'

export default function CategoryCard({title, image, id }) {

  return (
    <div>
        <Link to={`/categories/${id}`}>
            <div key={id} className={s.category_card} style={{backgroundImage: `url(http://localhost:3333${image})`, backgroundSize: 'cover'}} />
            <p className={s.card_title}>{title}</p>
        </Link>
    </div>
  )
}
